- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CPayments from organizations for
    the Massachusetts Democratic Party voter file (disclosed on line 15) are for the
    usual and normal charge based on market research and enhancements made to the
    file.  The rent figure charged to the Martha Coakley Committee is based on square
    footage occupied by each entity.  Based on the per square foot cost outlined in
    our lease and the square footage occupied by sublessor, we arrived at the rental
    figure.  In neither case is the sublessor paying more than the usual and normal
    charge as reflected in our lease.  Best Efforts:  A request is made of each contributor
    for employer and occupation information with an initial solicitation in the form
    of a uniform reply card requesting the necessary information.  In the event the
    contributor fails to comply, they receive a follow up letter within 30 days of
    the contribution requesting the information and providing the contributor with
    several methods (e.g. telephone, e-mail, fax, return envelope) to supply the necessary
    information.  In addition, staff queries the event host, online databases and
    other sources of employer and occupation information in order to determine the
    information.  If the information is still unavailable, the campaign deems that
    it has used its best efforts to comply with the regulations in this area.  Reports
    are amended as additional contributors provide their employer and occupation information."
